Torta de abóbora 🎃

👉 Ingredientes
Massa:
1 e 1/2 xic de mix de farinha sem glúten (usei amêndoas, polvilho doce e fécula de batata)
2 col de sopa de açúcar demerara
Pitada de sal
3 col de sopa de manteiga derretida
3 col de sopa de óleo de coco derretido
3 col de sopa de água gelada

Recheio:
1/2 xic de açúcar mascavo
1 col de café de canela, noz moscada, cravo e gengibre
Pitada de sal
2 ovos
400g de abóbora cabotiã assada e amassada
1 col de café de extrato de baunilha
200 ml de leite de coco

👉 Preparo
Preaqueça o forno a 180 graus
Em uma tigela, misture com as mãos os ingredientes da massa, fica uma massa que gruda muito na mão, mas é assim mesmo, vá abrindo ela em uma forma pequena (a minha tinha 22 cm de diâmetro), e reserve no freezer.
Em um liquidificador, bata todos os ingredientes do recheio e despeje na massa reservada no freezer
Asse de 40-45 minutos 🥧

