⁠.⁠⠀
Alkoholkonsum wirkt nicht nur auf einer Party auf Dich, sondern auch an darauf folgenden Tagen.⁠⠀
So hat der Konsum auch Einfluss auf Dein Training. Alkohol senkt Deinen Testosteronspiegel und bremst damit Dein Muskelwachstum.⁠⠀
Außerdem wird Deine Schlafqualität schlechter und das hat eine schlechtere Regeneration zur Folge.⁠⠀
⁠⠀
Hier einige Punkte von negativen Einflüssen auf Deinen Körper im Zusammenhang mit Alkohol:⁠⠀
⁠⠀
🔹Geringere Leistungsfähigkeit im Training⁠⠀
⁠⠀
🔹Verzögerte Regeneration⁠⠀
⁠⠀
🔹Dehydrierende Wirkung von Alkohol⁠⠀
⁠⠀
🔹Massig Kalorien erschweren das Abnehmen⁠⠀
⁠⠀
🔹Gehemmte Fettverbrennung⁠⠀
⁠⠀
🔹Kein Muskelaufbau⁠⠀
⁠⠀
🔹Schwerstarbeit fürs Herz⁠⠀
⁠⠀
🔹Gefahr der Unterzuckerung⁠⠀
⁠⠀
🔹Kein Training am Tag danach⁠⠀
⁠⠀
💥Alkohol liefert viele leere Kalorien, hemmt die Fettverbrennung und pusht den Appetit – eher unvorteilhaft fürs Abnehmen⁠⠀
💥Alkohol verhindert das Muskelwachstum⁠⠀
💥Alkohol lässt eure Leistungsfähigkeit stark sinken⁠⠀
💥Alkohol belastet euer Herz und eure Leber⁠⠀
💥Alkohol verzögert die Regeneration nach dem Training⁠⠀
💥Alkohol entzieht dem Körper Wasser und Mineralstoffe, die er für einen reibungslosen Stoffwechsel benötigt⁠⠀
💥Alkohol führt oft zum Kater – und dann heißt’s am Tag danach goodbye gesunde Ernährung und Workout⁠⠀
.⁠⠀
